import React from "react";
import Accordian from "../Components/accordians";
import "./Services.css";

function Services() {
  return (
    <React.Fragment>
      <div>
        <h2>Helloo</h2>
        <div className="d-flex">
          <Accordian count="01" />
          <Accordian count="02" />
        </div>
      </div>
    </React.Fragment>
  );
}

export default Services;
